INSERT INTO endings(id, nombre, descripcion, anime, num, created, updated) VALUES('5', 'No More Time Machine', 'No More Time Machine es el cuarto ending del anime y el segundo de la segunda temporada. Es interpretado por LiSA, con letras escritas por Furuya Shin, composición de Kousuke Noma y arreglos de Yashikin. Aparece en los episodios Sword Art Online II: ', '3', '2', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO endings(id, nombre, descripcion, anime, num, created, updated) VALUES('6', 'Shirushi', 'Shirushi (シルシ Shirushi) es el quinto ending del anime de Sword Art Online. Es interpretado por la cantante japonesa LiSA. Será publicado el 10 de diciembre del 2014. Se usó desde el episodio 43. cuando inicia el arco Mother`s Rosario. Es interpretada', '3', '2', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO endings(id, nombre, descripcion, anime, num, created, updated) VALUES('7', 'Sore wa Chiisa na Hikari no Yō na', 'l ending es Sore wa Chiisa na Hikari no Yō na (それは小さな光のような?) interpretado por Sayuri.', '4', '1', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO endings(id, nombre, descripcion, anime, num, created, updated) VALUES('8', 'Natsu ga Yattekuru', 'Es interpretado por Kitahara Sayaka(quien le pone la voz a Aoi Sorano).Apareció en el Episodio 1. ', '5', '1', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
INSERT INTO endings(id, nombre, descripcion, anime, num, created, updated) VALUES('9', 'Te wo Tsunagou', 'Este ending es interpretado por Kitahara Sayaka (voz japonesa de Skie Blue), Terasaki Yuka (voz japonesa de Arion Sherwind) y Oohara Takashi (voz japonesa de Víctor Blade). ', '5', '2', '2020-07-09 16:56:14', '2020-07-09 16:56:14'); 
